import React from 'react';
import '../assets/css/people.css';

function UsersTable({ users }) {
    return (
        <div className="flex-table">
            {users.map((user, index) => (
                <div className="flex-row" key={user.id || index}>
                    <div className="flex-cell"><img src={user.photo} alt={user.name} /></div>
                    <div className="flex-cell">{user.name}</div>
                    <div className="flex-cell">{user.age}</div>
                </div>
            ))}
        </div>
    );
}

export default UsersTable;
